import React from "react";
import GameCard from "./gameCard";


export default function GameCards(games){
    console.log(games.games)
    return (
        <div>
        {games.map(g=>{
            return(
            <GameCard key={g.id}
            name={g.name} 
            image={g.image}
            genres={g.genres}
            />)})
        }
        </div>
    )
}
